Das ist der Besitz der Söhne Asers nach ihren einzelnen Geschlechtern, ihren Städten und deren Dörfern.
Das sechste Los fiel auf die Söhne Nephthalis nach ihren einzelnen Geschlechtern;
und die Grenze beginnt von Heleph und Elon bei Saananim und Adami, das ist Nekeb, und bei Jebnael bis Lekum, und läuft fort bis an den Jordan.
